  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Zones are derived from a focal mean
  analysis on bathymetry and slope. The grid is based on gridded (5 m cell size) multibeam
  bathymetry, collected aboard R/V AHI merged with seafloor depths derived from multispectral
  IKONOS satellite imagery. BPI Zones was created using the Benthic Terrain Modeler
  (http://www.csc.noaa.gov/products/btm/). Cell values represent one of 4 classes
  (crest, depression, slope, flat) in an index of seafloor terrains. This data set
  is for Rose Atoll, American Samoa.\",\n\t\"license_title\": null,\n\t\"extras\":
